import express from 'express';
import bodyParser from 'body-parser';
import { createRequire } from 'module';
const require = createRequire(import.meta.url);
const dialogflowfulfillment = require('dialogflow-fulfillment');

const app = express();
app.use(bodyParser.json());

app.get('/api/webhook/dialogflow/', (req, res) => {
  res.status(200).send('I have tried again : port 3014');
});

app.post('/api/webhook/dialogflow/', express.json(), (req, res) => {
  const agent = new dialogflowfulfillment.WebhookClient({
    request: req,
    response: res,
  });

  // Get the user's locale language
  const locale = agent.locale;

  // Wrapper function to check locale language
  function checkLocaleAndExecute(handler) {
    return (agent) => {
      const locale = agent.locale;
      if (locale == 'en' || locale == 'zu') {
        return handler(agent);
      } else {
        agent.add('Sorry, your language is not supported.');
      }
    };
  }

  function uniApplyBotAgent(agent) {
    if (locale == 'en') {
      agent.add('Getting the responses from the webhook');
    } else if (locale == 'zu') {
      agent.add('Sawubona, singakusiza ngani');
    }
  }

  function GetUjInfo(agent) {
    var payloadResponse;
    if (locale == 'en') {
      payloadResponse = {
        "richContent": [
          [
            {
              "type": "accordion",
              "title": "University of Johannesburg"
            },
            {
              "type": "image",
              "title": "University Of Johannesburg",
              "accessibilityText": "University Of Johannesburg",
              "rawUrl": "data:image/png;base64,"
            },
            {
              "type": "accordion",
              "title": "Please access those links below to apply"
            },
            {
              "type": "chips",
              "options": [
                {
                  "text": "Undergraduate link Application",
                  "image": {
                    "src": {
                      "rawUrl": "data:image/png;base64,"
                    }
                  },
                  "link": "https://registration.uj.ac.za/pls/prodi41/gen.gw1pkg.gw1startup?x_processcode=ITS_OAP"
                },
                {
                  "link": "https://registration.uj.ac.za/pls/prodi41/w99pkg.mi_login",
                  "image": {
                    "src": {
                      "rawUrl": "data:image/png;base64,"
                    }
                  },
                  "text": "Returning student link Application"
                },
                {
                  "image": {
                    "src": {
                      "rawUrl": "data:image/png;base64,"
                    }
                  },
                  "text": "POST student link Application",
                  "link": "https://registration.uj.ac.za/pls/prodi41/gen.gw1pkg.gw1startup?x_processcode=ITS_OAP"
                },
                {
                  "image": {
                    "src": {
                      "rawUrl": "data:image/png;base64,"
                    }
                  },
                  "text": "Explore more about University of Johannesburg",
                  "link": "https://www.uj.ac.za/admissions/undergraduate/"
                }
              ]
            }
          ]
        ]
      };
    } else if (locale == 'zu') {
      payloadResponse = {
        "richContent": [
          [
            {
              "type": "accordion",
              "title": "University of Johannesburg"
            },
            {
              "type": "image",
              "title": "University Of Johannesburg",
              "accessibilityText": "University Of Johannesburg",
              "rawUrl": "data:image/png;base64,"
            },
            {
              "type": "accordion",
              "title": "Please access those links below to apply"
            },
            {
              "type": "chips",
              "options": [
                {
                  "text": "Abaqala ukufaka izicelo zokufunda",
                  "image": {
                    "src": {
                      "rawUrl": "data:image/png;base64,"
                    }
                  },
                  "link": "https://registration.uj.ac.za/pls/prodi41/gen.gw1pkg.gw1startup?x_processcode=ITS_OAP"
                },
                {
                  "link": "https://registration.uj.ac.za/pls/prodi41/w99pkg.mi_login",
                  "image": {
                    "src": {
                      "rawUrl": "data:image/png;base64,"
                    }
                  },
                  "text": "izifundiswa eziphindayo"
                },
                {
                  "image": {
                    "src": {
                      "rawUrl": "data:image/png;base64,"
                    }
                  },
                  "text": "Faka isicelo sakho sokufunda",
                  "link": "https://registration.uj.ac.za/pls/prodi41/gen.gw1pkg.gw1startup?x_processcode=ITS_OAP"
                },
                {
                  "image": {
                    "src": {
                      "rawUrl": "data:image/png;base64,"
                    }
                  },
                  "text": "Funda kabanzi ngenyuvesi",
                  "link": "https://www.uj.ac.za/admissions/undergraduate/"
                }
              ]
            }
          ]
        ]
      };
    } else {
      agent.add('Sorry, your language is not supported.');
      return;
    }

    agent.add(
      new dialogflowfulfillment.Payload(agent.UNSPECIFIED, payloadResponse, {
        sendAsMessage: true,
        rawPayload: true,
      })
    );
  }

  var intentMap = new Map();

  // Use the wrapper function
  intentMap.set('greetings', checkLocaleAndExecute(uniApplyBotAgent));
  intentMap.set('GetUjInfo', checkLocaleAndExecute(GetUjInfo));

  agent.handleRequest(intentMap);
});

const PORT = process.env.PORT || 3014;

app.listen(PORT, () => {
  console.log(`Webhook server is running on port ${PORT}`);
});
